description:
- Gestion des Ressources Humaines : recrutement des étudiants, gestion des dossiers ;
- Gestion administrative : gestion documentaire, gestion des relations avec l'administration et l'Université ; 
- Management : gestion et suivi d'une équipe ;   
- Gestion de projets : organisation de la campagne de recrutement et de formation des étudiants, construction de plans d'actions et mise en place de stratégies commerciales ;

- Application de la Maîtrise Statistique des Procédés et Six Sigma dans une démarche qualité ;
- Mise en place de cartes de contrôles ; 
- Statistiques descriptives / inférentielles sous R / Minitab / Ellistat ;
- Développement d'un outil statistique sous R Shiny / VBA.

Rattaché au Département Risque de Crédit, je suis en charge de :

Accompagner l’équipe à donner le meilleur d’elle-même en mettant en place les process d'initiation, suivi et documentation adaptés à chaque type de projet ;
Veille et préparation des technologies et infrastructure de déploiement projets data;
Mettre en place les modèles et les outils nécessaires en utilisant les techniques les plus récentes (AI), tout en répondant au besoin du business;
Contribuer au maintient risque de crédit en conformité avec les orientations stratégiques du Management ;

Sujet : "NLP : Natural language processing  "
Arrangement par : Ecole IA Microsoft powered by Simplon x 10h11
  
Langue : Français

Ce cours a couvert les sujets suivants :

- Dictionnaire de données : définition, pour quoi en faire un, comment le rédiger ; 
- Traitement de chaînes de caractères avec R : présentation des fonctions les plus utilisées dans R (gsub, paste, strsplit, ...) ;
- Analyse de la fréquence des mots : la lemmatisation avec TreeTagger, les stopwords ;
- L’analyse des sentiments : application du lexicon FEEL ;
- Fake articles et application pratique avec les chaînes de Markov ;
- Text Classification : génération d’un dataset d'apprentissage, labellisation, le processus de Text Classification, la librairie R “RTextTools”.

Service : Mise en place d’un modèle de notation portant sur la clientèle "professions juridiques"
Arrangement par : Groupe Caisse des Dépôts - 10h11

Langage de programmation : R

Étapes principales :
1) analyses exploratoires uni et bivariées ;
2) traitement des outliers ;
3) développement des indicateurs complémentaires ;
4) modélisation.

Sujet : "Data & Machine Learning" 
Arrangement par : Ynov - 10h11
Participants : Ingésup Master 1 et Master 2 

Langue : Français

Ce cours a couvert les sujets suivants :

FIRST MODULE : Data Science
1) Introduction to Data Science : Data Science, the Data Scientist, the methodology ;
2) Introduction to R Programming : the tool, R objects, general functions ;
3) Process and interrogate data : searching and collecting data, processing and cleaning data, interrogating data, applications.

SECOND MODULE : Machine Learning
1) Introduction to Machine Learning : Big Data, the learning process, how to build a ML model ;
2) ML Algorithms : Supervised and Unsupervised Learning Algorithms, focus on : a) Nearest Neighbors, b) Decision Trees, c) Generalized linear models ;
3) ML application : the Poisson regression, the Dixon and Coles (1997) model, and how to predict scores of French football Ligue 1 matches.

Sujet : "Data Science"
Arrangement par : IESA Multimédia - 10h11
Participants : Mastère 1 Social Media et Web Marketing - 39 étudiants

Dates de l'événement : 20 et 27 Avril 2016
Durée de l'événement : 16 heures
Sessions : 2 sessions

Langue : Français

Ce cours a couvert les sujets suivants:

1) Data Science : intro à la Data Science, Data & Big Data, les types de questions ;
2) Le Data Scientist : Qui est le Data Scientist et que fait-il/elle ;
3) L'outil : intro à la Programmation en R et applications ;
4) La méthodologie : le processus de la Data Science, l'analyses de données exploratoires, la communication des données ;
5) Etude de cas : Comment piloter l’image et le discours en ligne de sa marque en optimisant l’investissement média ?
